import { Component } from '@angular/core';

@Component({
  selector: 'app-test',
  template: `
    <div>
      <h1>Welcome {{name}}</h1>
      <input type="text" value="{{name}}">
    </div>
  `,
  styleUrls: ['./test.component.css']
})
export class TestComponent {
  name : any = 'karthick';
  age : number = 18;
  siteUrl = window.location.href;


  greet(){
    return "hi"+ this.name+ 'with age'+this.age;
  }


}
